// MainPage.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './mainpage.css'; // Ensure your CSS file is in the correct location
import heading from './assets/heading.png'; // Fix the extra space in the path
import Background from './Background';

const MainPage = () => {
  const navigate = useNavigate();

  const handleVisualizerClick = () => {
    navigate('/visualizer');
  };

  return (
    <div className="mp">
      <Background />
      {/* Use the imported 'heading' directly as the src */}
      <img src={heading} alt="Letter Heading" style={{ height: '80px', width: 'auto' }} />
      <h1></h1>
      <button className="direct" onClick={handleVisualizerClick}>
        Get Started
      </button>
    </div>
  );
};

export default MainPage;
